import React from 'react';
import Nav from '../Nav';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import Poster from '../assets/MoviePoster.jpeg';
import Poster2 from '../assets/ReadyPlayer.jpeg';
import Poster3 from '../assets/SearchMain.jpg';
import { movieList } from '../movieList';
import Movie from '../components/Movie';

const moveTo = () => {
  window.location.href = "/Running";
}

function Home() {

  return (
    <div className="Home">
      <Nav />
      <div className="upperSection">
        <div id="carouselExampleCaptions" class="carousel slide" data-bs-ride="carousel">
          <div class="carousel-indicators">
            <button type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide-to="0" class="active" aria-current="true" aria-label="Slide 1"></button>
            <button type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide-to="1" aria-label="Slide 2"></button>
            <button type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide-to="2" aria-label="Slide 3"></button>
          </div>
          <div class="carousel-inner">
            <div class="carousel-item active">
              <div className="image-wrapper">
              <img src={Poster} class="d-block w-100 img-fluid" alt="movie" style={{objectFit: "cover", height: '100%',filter: 'blur(5px)'}}/>
              </div>
            <div class="carousel-caption d-none d-md-block">

              <h5 style={{fontSize: "40px"}}>LALA Land</h5>
              <p style={{marginBottom: "100px", fontSize: "20px"}}>LaLa Land is the Best Movie to watch with Couples</p>
              <button className="btn btn-secondary" style={{marginBottom: "100px"}} onClick={moveTo}>Watch this right now!</button>
            </div>
          </div>
          <div class="carousel-item">
            <div className="image-wrapper">
              <img src={Poster2} class="d-block w-100" alt="movie" style={{objectFit: "cover", height: '100%',filter: 'blur(5px)' }}/>
            </div>
          <div class="carousel-caption d-none d-md-block">

            <h5 style={{fontSize: "40px", color:"black"}}>Ready Player one</h5>
            <p style={{marginBottom: "100px", fontSize: "20px", color:"black"}}>Best Action Movie ever!!</p>
            <button className="btn btn-secondary" style={{marginBottom: "100px"}} onClick={moveTo}>Watch this right now!</button>
          </div>
        </div>
        <div class="carousel-item">
           <div className="image-wrapper">
            <img src={Poster3} class="d-block w-100" alt="movie" style={{objectFit: "cover", height: '100%',filter: 'blur(5px)'}}/>

          </div>
        <div class="carousel-caption d-none d-md-block">

          <h5 style={{fontSize: "40px"}}>Free guy</h5>
          <p style={{marginBottom: "100px", fontSize: "20px"}}>Try Enjoy watchting NPCs.</p>
          <button className="btn btn-secondary" style={{marginBottom: "100px"}} onClick={moveTo}>Watch this right now!</button>
        </div>
      </div>
    </div>
    <button class="carousel-control-prev" type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide="prev">
      <span class="carousel-control-prev-icon" aria-hidden="true"></span>
      <span class="visually-hidden">Previous</span>
    </button>
    <button class="carousel-control-next" type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide="next">
      <span class="carousel-control-next-icon" aria-hidden="true"></span>
      <span class="visually-hidden">Next</span>
    </button>
  </div>
  </div>
  {/* <div className="videoList">
    Today's enjoyable Movie!
    <div className="MovieList">
      {
        movieList.results.map((item) => {
          return(
            <Movie 
              title={item.original_title}
              poster_path={item.poster_path}
              vote_average={item.vote_average}
            />
          )
        })
      }
    </div> */}
  </div>

  );
}

export default Home;
